import { Component, OnInit } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
import { SpaceXAPIService } from '../services/space-x-api.service';

@Component({
  selector: 'app-missiondetails',
  templateUrl: './missiondetails.component.html',
  styleUrls: ['./missiondetails.component.css']
})
export class MissionDetailsComponent implements OnInit {
  mission: any;

  constructor(
    private route: ActivatedRoute,
    private spaceXService: SpaceXAPIService
  ) { }

  ngOnInit(): void {
    this.route.params.subscribe(params => {
      const flightNumber = params['flight_number'];
      this.spaceXService.getMissionDetails(flightNumber).subscribe(mission => {
        this.mission = mission;
      });
    });
  }

}
